The book also included two CDs with fifteen total tracks.  This torrent is those two CDs.  They include interviews with Lucas, the stars, John Williams, parts of the Star Wars Radio Drama, radio commercials for the movies, etc.

It's a total of 15 tracks.  I hope you enjoy!
